import React from 'react';

function TaskList({ tasks }) {
  // Implement task management functionality (e.g., add, delete, update tasks)

  return (
    <div className="task-list">
      <h2>Tasks</h2>
      {tasks.length === 0 ? (
        <p>No tasks found.</p>
      ) : (
        <ul>
          {tasks.map((task) => (
            <li key={task.id}>
              {task.title} - {task.completed ? 'Completed' : 'Incomplete'}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default TaskList;
